// ==UserScript==
// @name         AutoSP
// @namespace    https://github.com/PunThePancake/AutoSP
// @version      0.1
// @description  Automatically add youtube video to soundpad (uses mp4 just in case you later want to send the video, this is also very much subject to change)
// @author       Logie
// @match        https://www.youtube.com/watch*
// @grant        GM_xmlhttpRequest
// @connect      localhost
// @license      MIT
// @downloadURL https://update.greasyfork.org/scripts/494395/AutoSP.user.js
// @updateURL https://update.greasyfork.org/scripts/494395/AutoSP.meta.js
// ==/UserScript==

(function() {
    'use strict';

    const customSVG = `
<svg class="custom-svg" width="876" height="876" viewBox="0 0 876 876" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
<g clip-path="url(#clip0_4_14)">
<mask id="mask0_4_14" style="mask-type:luminance" maskUnits="userSpaceOnUse" x="0" y="0" width="876" height="876">
<path d="M876 0H0V876H876V0Z" fill="white"/>
</mask>
<g mask="url(#mask0_4_14)">
<mask id="mask1_4_14" style="mask-type:alpha" maskUnits="userSpaceOnUse" x="0" y="0" width="876" height="876">
<path d="M876 0H0V876H876V0Z" fill="url(#pattern0_4_14)"/>
</mask>
<g mask="url(#mask1_4_14)">
<path d="M876 0H0V876H876V0Z" fill="white"/>
</g>
</g>
</g>
<defs>
<pattern id="pattern0_4_14" patternContentUnits="objectBoundingBox" width="1" height="1">
<use xlink:href="#image0_4_14" transform="scale(0.00114155)"/>
</pattern>
<clipPath id="clip0_4_14">
<rect width="876" height="876" fill="white"/>
</clipPath>
<image id="image0_4_14" width="876" height="876" xlink:href="data:image/png;base64,"/>
</defs>
</svg>
    `;

    // Function to send data to the server
    function sendData(videoUrl) {
        GM_xmlhttpRequest({
            method: "POST",
            url: "http://localhost:4999/track-video",
            data: JSON.stringify({ url: videoUrl }),
            headers: {
                "Content-Type": "application/json"
            },
            onload: function(response) {
                console.log(response.responseText);
            }
        });
    }

    // Function to add sample SVG div to the YouTube video player controls
    function addSampleSVG() {
        var controls = document.querySelector('.ytp-chrome-controls');
        if (controls) {
            var sampleDiv = document.createElement('div');
            sampleDiv.classList.add('custom-sample-div'); // Add a class to the div
            sampleDiv.style.width = '48px'; // Set width to 40px
            sampleDiv.style.height = '48px'; // Set height to 40px
            var svg = customSVG
            sampleDiv.innerHTML = svg;
            sampleDiv.style.marginRight = '10px';
            sampleDiv.style.cursor = 'pointer';
            sampleDiv.onclick = function() {
                var videoUrl = window.location.href;
                sendData(videoUrl);
            };
            // Insert as the second child of ytp-chrome-controls
            var firstChild = controls.children[1];
            controls.insertBefore(sampleDiv, firstChild);

            // Dynamically add CSS rules
            var style = document.createElement('style');
            style.textContent = `
                .custom-sample-div {
                    width: 40px;
                    height: 40px;
                    display: flex;
                    align-items: center;
                    justify-content: center;
                    scale: 1;
                    transition: 0.2s;
                }

                .custom-sample-div:hover {
                    transition: 0.2s;
                    scale: 1.1;
                }

                .custom-svg {
                    width: 25px;
                    height: 25px;
                    fill: #fff;
                    color: #fff;
                    transition: 0.2s;
                }

            `;
            document.head.appendChild(style);
        }
    }

    // Check if the video player controls have loaded
    var checkExist = setInterval(function() {
        if (document.querySelector('.ytp-chrome-controls')) {
            clearInterval(checkExist);
            addSampleSVG();
        }
    }, 100); // Check every 100ms

})();

